CREATE TABLE indiewise_db.Country
(
    id char(36) PRIMARY KEY NOT NULL,
    cca2 varchar(255),
    cca3 varchar(255),
    ccn3 varchar(255),
    cioc varchar(255),
    createdAt datetime,
    demonym varchar(255),
    landlocked bit(1),
    region varchar(255),
    subregion varchar(255),
    updatedAt datetime,
    area decimal(50,8),
    capital varchar(255),
    name varchar(255),
    regionCode varchar(255),
    subregionCode varchar(255)
);
CREATE UNIQUE INDEX country_id_unique ON indiewise_db.Country (id);
